export const iconFinder = (iconName: keyof typeof icons | string, hideWhenNotFound = false) => {
  const icon = icons[iconName as keyof typeof icons]
  if (!icon ) {
    if (hideWhenNotFound) return '<div class="w-[15px] h-[15px]"></div>'
    return '<div>?</div>'
  }
  return icon
}
